(5, 'Walnut Park Apartment', '<p>Only 11 miles from downtown Austin, the heavily-wooded site borders Walnut Creek and offers residents inspiring views in an unparalleled, secluded community</p><ul><li>Heavily wooded site with dramatic 30-foot bluffs overlooking the scenic Walnut Creek</li><li>Conveniently located on North Lamar near numerous shops, major employers and restaurants</li><li>Easy access to I-35 and a short distance to US-183 and SH-45</li><li>Elegant clubhouse with a full kitchen, bar area, lounging area and creek-view veranda</li><li>24-hour fully-equipped fitness center with lockers and changing area</li><li>Indoor spa with cascading waterfall, steam room and cedar sauna</li><li>Spacious, gourmet kitchens with granite countertops and backsplashes</li><li>Stainless steel appliances and natural gas ranges</li><li>Designer hardwood cabinets with under-cabinet lighting</li></ul>', 'North Lamar Boulevard, Austin, Texas 78753, USA', '{\"1\":\"properties\\/8.jpg\",\"2\":\"properties\\/7.jpg\",\"3\":\"properties\\/5.jpg\",\"4\":\"properties\\/1-1.jpg\"}', 0, 2, 2, 1, 980, '2035.00', NULL, 1, 'selling', '2019-11-18 00:47:52', '2023-06-03 00:44:54', 'rent', 'Heavily wooded site with dramatic 30-foot bluffs overlooking the scenic Walnut Creek\nConveniently located on North Lamar near numerous shops, major employers and restaurants\nEasy access to I-35 and a short distance to US-183 and SH-45\nElegant clubhouse with a full kitchen, bar area, lounging area and creek-view veranda', 1, 1, 'month', NULL, 'Botble\\RealEstate\\Models\\Account', 'approved', '2023-07-10', 0, 1, '42.669053', '-75.578469', 4768, 1, 1, NULL),
(6, '5 beds luxury house', '<p>Luxury and spacious remodeled house in Sea Cliff with 3 levels, 5 bedrooms and 4 bathrooms, and a great Golden Gate View. 4-Car garage. The house is remodeled and spacious with a great layout, and is offered furnished. It is charming and beautiful with lots of details, has thoughtful front landscaping and a large backyard and a patio, and has a great view of the Golden Gate. On the main level the entry opens to a large foyer which connects to a beautiful and large living room with a fireplace, and to a formal dining room.</p>\r\n\r\n<p>The house has a garage which can accommodate 3 to 4 cars. The house is offered furnished. Can be leased for short term or long term. The minimum lease term is 3 months.</p>', 'Seacliff San Francisco, Sea Cliff Avenue, San Francisco, CA 94121, USA', '[\"properties\\/a3.jpg\",\"properties\\/a1.jpg\",\"properties\\/a2.jpg\",\"properties\\/a4.jpg\"]', 2, 5, 4, 3, 270, '1808.00', NULL, 1, 'renting', '2019-11-18 01:05:58', '2023-05-25 20:33:13', 'rent', 'Luxury and spacious remodeled house in Sea Cliff with 3 levels, 5 bedrooms and 4 bathrooms, and a great Golden Gate View. 4-Car garage. The house is remodeled and spacious with a great layout, and is offered furnished. It is charming and beautiful with lots of details, has thoughtful front landscaping and a large backyard and a patio, and has a great view of the Golden Gate', 1, 1, 'month', 5, 'Botble\\RealEstate\\Models\\Account', 'approved', '2023-07-10', 0, 1, '42.946985', '-76.206616', 6837, 1, 1, NULL);
INSERT INTO `re_properties_translations` (`lang_code`, `re_properties_id`, `name`, `description`, `content`, `location`) VALUES
('ar', 6, '5 beds luxury house', 'Luxury and spacious remodeled house in Sea Cliff with 3 levels, 5 bedrooms and 4 bathrooms, and a great Golden Gate View. 4-Car garage. The house is remodeled and spacious with a great layout, and is offered furnished. It is charming and beautiful with lots of details, has thoughtful front landscaping and a large backyard and a patio, and has a great view of the Golden Gate', '<p>Luxury and spacious remodeled house in Sea Cliff with 3 levels, 5 bedrooms and 4 bathrooms, and a great Golden Gate View. 4-Car garage. The house is remodeled and spacious with a great layout, and is offered furnished. It is charming and beautiful with lots of details, has thoughtful front landscaping and a large backyard and a patio, and has a great view of the Golden Gate. On the main level the entry opens to a large foyer which connects to a beautiful and large living room with a fireplace, and to a formal dining room.</p><p>The house has a garage which can accommodate 3 to 4 cars. The house is offered furnished. Can be leased for short term or long term. The minimum lease term is 3 months.</p>', 'Seacliff San Francisco, Sea Cliff Avenue, San Francisco, CA 94121, USA');
